import React from "react";
import{Switch, Route} from "react-router-dom"
import Header from "./Header";
import NotFound from "./NotFound";
import Home from "./Home.js"
import Study from "./Study.js"
import CreateDeck from "./CreateDeck.js"
import Deck from "./Deck.js"
import EditDeck from "EditDeck.js"
import AddCard from "AddCard.js"
import EditCard from "EditCard.js"

function Layout() {
  return (
  <>


<div className="container">
  {/* The Header component remains at the top of the page no matter the current route */}
  <Header /> 
    <Switch>
    {/* Route for Home page */}
      <Route exact = {true} path="/">  
        <Home /> 
      </Route>
    {/* Route for study page */}
      <Route path="/desk/:deskId/study">
        <Study />
      </Route>
    {/* Route for Create Deck */}
    <Route path="/decks/new">
      <CreateDeck />  
    </Route>
    {/* Route for Deck */}
    <Route path="/decks/:deckId">
      <Deck />
    </Route>
    {/* Route for Edit Deck */}
    <Route path="/decks/:deck">
      <EditDeck.js />
    </Route>
    {/* Route for Add Card */}
    <Route>
      <AddCard />
    </Route>
    {/* Route for Edit Card */}
    <Route>
      <EditCard />
    </Route>
    {/* Route for Not Found */}
    <Route>
      <NotFound />
    </Route>
  </Switch>
</div>

  </>
  );
}

export default Layout;
